import React from 'react';
import Card from '../components/Card';

class Portfolio extends React.Component {
    render() {
        return (
            <main className='main-portfolio'>
                <Card 
                    title='Avatar the Last Airbender Guessing Game'
                    description="An Avatar-themed phrase guessing game (it's my favorite show). Its Javascript code includes event listeners that produce a game very similar to a regular game of Hangman."
                    img={{
                        src: require('../content/images/avatar.png'),
                        alt: 'Avatar: The Last Airbender Title Screen'
                    }}

                />

            </main>
        );
    }
}


export default Portfolio;
